export async function chatList() {
  return fetch(`https://api.chatengine.io/chats`, {
    headers: {
      "Project-ID": "e6ec3c5e-784a-4e8e-a39c-3f544022765c",
      "User-Name": "Michelle",
      "User-Secret": "123",
    },
  }).then((response) => {
    return response.json();
  });
}

export async function chatFeed(id) {
  return fetch(`https://api.chatengine.io/chats/${id}/messages`, {
    headers: {
      "Project-ID": "e6ec3c5e-784a-4e8e-a39c-3f544022765c",
      "User-Name": "Michelle",
      "User-Secret": "123",
    },
  }).then((response) => {
    return response.json();
  });
}
